import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenses = [
    {amount: 249.7, title: "Car Insurence", date: new Date(2022, 2, 20) },
    {amount: 145.4, title: "Bike Insurence", date: new Date(2022, 2, 20) },
    {amount: 639.1, title: "Home Insurence", date: new Date(2022, 2, 20) }
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
